import DocViewer, { DocViewerRenderers } from "react-doc-viewer";

function App() {
  const docs = [{ uri: "/Display.pdf" }];

  return (
    <div className="App">
      <DocViewer documents={docs} pluginRenderers={DocViewerRenderers} />
    </div>
  );
}

export default App;
